import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
    <>
    <h1> My Clock</h1>
    <p>Date: May 17th 2021</p>
    <p>Time: 5:00 pm</p>
    </>,
    document.getElementById('root')
);


